import React from "react";

export const Navigation = (props) => {
  return (
    <nav id="menu" className="navbar navbar-default navbar-fixed-top">
      <div className="container">
        <div className="navbar-header">
          <button
            type="button"
            className="navbar-toggle collapsed"
            data-toggle="collapse"
            data-target="#bs-example-navbar-collapse-1"
          >
            {" "}
            <span className="sr-only">Toggle navigation</span>{" "}
            <span className="icon-bar"></span>{" "}
            <span className="icon-bar"></span>{" "}
            <span className="icon-bar"></span>{" "}
          </button>
          <a
            className="navbar-brand page-scroll"
            href="#page-top"
            onClick={(e) => {
              if (props.onNavigate) {
                e.preventDefault();
                props.onNavigate("#page-top");
              }
            }}
          >
            <img src="img/nav-logo.png" alt="logo" className="navbar-logo" />
            Adopt a Pet
          </a>{" "}
        </div>

        <div
          className="collapse navbar-collapse"
          id="bs-example-navbar-collapse-1"
        >
          <ul className="nav navbar-nav navbar-right">
            <li>
              <a
                href="#features"
                className="page-scroll"
                onClick={(e) => {
                  if (props.onNavigate) {
                    e.preventDefault();
                    props.onNavigate("#features");
                  }
                }}
              >
                Features
              </a>
            </li>
            <li>
              <a
                href="#about"
                className="page-scroll"
                onClick={(e) => {
                  if (props.onNavigate) {
                    e.preventDefault();
                    props.onNavigate("#about");
                  }
                }}
              >
                About
              </a>
            </li>
            <li>
              <a
                href="#adoption"
                className="page-scroll"
                onClick={(e) => {
                  if (props.onNavigate) {
                    e.preventDefault();
                    // navigate to the adoption page
                    props.onNavigate("#adoption-page");
                  }
                }}
              >
                Adopt
              </a>
            </li>
            <li>
              <a
                href="#portfolio"
                className="page-scroll"
                onClick={(e) => {
                  if (props.onNavigate) {
                    e.preventDefault();
                    props.onNavigate("#portfolio");
                  }
                }}
              >
                Gallery
              </a>
            </li>
            <li>
              <a
                href="#testimonials"
                className="page-scroll"
                onClick={(e) => {
                  if (props.onNavigate) {
                    e.preventDefault();
                    props.onNavigate("#testimonials");
                  }
                }}
              >
                Testimonials
              </a>
            </li>
            <li>
              <a
                href="#team"
                className="page-scroll"
                onClick={(e) => {
                  if (props.onNavigate) {
                    e.preventDefault();
                    props.onNavigate("#team");
                  }
                }}
              >
                Team
              </a>
            </li>
            <li>
              <a
                href="#contact"
                className="page-scroll"
                onClick={(e) => {
                  if (props.onNavigate) {
                    e.preventDefault();
                    props.onNavigate("#contact");
                  }
                }}
              >
                Contact
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};
